import React , { useState } from 'react';
import './faq.css';
import MyFaq from './MyFaq'
import { FaqQuestion } from '../api';

const Faq = () => {
    const [data, setdata] = useState(FaqQuestion);
    return (
        <>
       {
                data.map((currElement)=>{
                 return <MyFaq key={currElement.id}/>;
             })
            
        }

        </>
    )
}

export default Faq
